import { getActiveStates } from "./fakeStateService";

const defaults = {
  investorInformation: {
    secondaryMarket: false,
    startDate: "",
    passiveIncomeGoal: 5000,
    investmentCapital: 25000,
    netRentBreakdown: {
      paydownDebtPct: 50,
      reinvestPct: 30,
      spendPct: 20
    },
    locations: {
      location1: {},
      location2: {},
      location3: {}
    },
    lienCosts: {
      location1: {
        avgLienCostLiveAuction: getActiveStates()[0].avgLienCostLiveAuction,
        avgLienCostSecondary: getActiveStates()[0].avgLienCostSecondary
      }
    }
  },
  dealInformation: {
    redemptionRatio: 6,
    isFullyManaged: false,
    avgGrossRent: 650,
    expenses: {
      management: 10,
      vacancy: 12,
      repair: 8
    }
  },
  serviceType: {
    setup: true,
    recurring: false,
    fullyManaged: false
  }
};

export function getDefaults() {
  return defaults;
}
